import React, { useEffect } from "react";
import styled from "styled-components";
import { useParams } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { getPokemon } from "../redux/actions";
import { Loader } from "../components/Loader";
export const DetailPage = () => {
  const pokemonState = useSelector((state) => state.pokemon);
  const dispatch = useDispatch();
  const { id } = useParams();

  useEffect(() => {
    dispatch(getPokemon(id));
  }, []);
  return (
    <Container>
      {loading ? (
        <Loader />
      ) : (
        <>
          <div className="header-main-pokemon">
            <span className="number-pokemon">#{pokemonState.id}</span>
            <div className="container-img-pokemon">
              <img
                src={pokemonState.image}
                alt={`Pokemon ${pokemonState?.name}`}
              />
            </div>

            <div className="container-info-pokemon">
              <h1>{pokemonState.name}</h1>
              <div className="card-types info-pokemon-type">
                {pokemonState.tipos.map((tipo) => (
                  <span
                    key={tipo.name ? tipo.name : tipo}
                    className={`${tipo.name ? tipo.name : tipo}`}
                  >
                    {tipo.name ? tipo.name : tipo}
                  </span>
                ))}
              </div>
              <div className="info-pokemon">
                <div className="group-info">
                  <p>Altura</p>
                  <span>{pokemonState.altura}</span>
                </div>
                <div className="group-info">
                  <p>Peso</p>
                  <span>{pokemonState.peso}</span>
                </div>
              </div>
            </div>
          </div>

          <div className="container-stats">
            <h1>Estad√≠sticas</h1>
            <div className="stats">
              <div className="stat-group">
                <span>Hp</span>
                <div className="progress-bar"></div>
                <span className="counter-stat">{pokemonState.vida}</span>
              </div>
              <div className="stat-group">
                <span>Attack</span>
                <div className="progress-bar"></div>
                <span className="counter-stat">{pokemonState.fuerza}</span>
              </div>
              <div className="stat-group">
                <span>Defense</span>
                <div className="progress-bar"></div>
                <span className="counter-stat">{pokemonState.defensa}</span>
              </div>

              <div className="stat-group">
                <span>Speed</span>
                <div className="progress-bar"></div>
                <span className="counter-stat">{pokemonState.velocidad}</span>
              </div>
            </div>
          </div>
        </>
      )}
    </Container>
  );
};

const Container = styled.main`
  display: flex;
  flex-direction: column;
  margin-top: 100px;
  margin-bottom: 50px;
  .header-main-pokemon {
    margin-top: 20px;
    display: flex;
    align-items: center;
    position: relative;
  }

  .number-pokemon {
    position: absolute;
    top: -130px;
    left: 0;
    font-size: 200px;
    font-weight: 700;
    color: var(--color-primary-hover);
  }

  .container-img-pokemon {
    order: 2;
    flex: 1;
    padding: 25px 25px 25px 0;
    height: 400px;
    img {
      height: 100%;
      width: 100%;
    }
  }
  .container-info-pokemon {
    display: flex;
    flex-direction: column;
    order: 1;
    flex: 1;
    h1 {
      text-align: right;
      font-size: 60px;
    }
  }

  .info-pokemon {
    display: flex;
    justify-content: space-between;
    margin-top: 20px;
  }

  .group-info {
    display: flex;
    flex-direction: column;
    gap: 10px;
    p {
      font-weight: 700;
      font-size: 20px;
    }
  }
  .container-stats {
    display: flex;
    gap: 50px;
    align-items: center;
    .stats {
      display: flex;
      flex-direction: column;
      gap: 20px;
      flex: 1;
    }
    .stat-group {
      display: flex;
      align-items: center;
      gap: 20px;
    }
    span {
      flex: 20%;
      font-weight: 500;
      font-size: 18px;
    }
    .progress-bar {
      width: 100%;
      height: 30px;
      background-color: #006d77;
      border-radius: 10px;
    }
  }
`;
